import styled from "styled-components";

function Header() {
  return (
    <Container>
      <Wrapper>
        <h1>Nepp Movie</h1>
      </Wrapper>
    </Container>
  );
}

const Container = styled.div`
  background-color: #ddd;
`;

const Wrapper = styled.div`
  max-width: 900px;
  height: 60px;

  margin: 0 auto;
  background-color: #eee;
`;

export default Header;
